[mcu]
#serial: /dev/serial/by-id/usb-Klipper_lpc1768_3190020981A0C8956F284161C32000F5-if00
canbus_uuid: b083043d66d9
canbus_interface: printCAN1


[force_move]
enable_force_move: True

[menu __main __octoprint]
type: disabled

[virtual_sdcard]
path: /home/dinec/S8_data/gcodes
on_error_gcode: 
  TTS_ERROR
  CANCEL_PRINT

[display_status]

[pause_resume] 
recover_velocity: 250.0

[exclude_object]

[gcode_arcs]
resolution: 0.1

[heater_bed]
heater_pin: PD7
sensor_type: EPCOS 100K B57560G104F
sensor_pin: PA1
#control: pid
#pid_Kp: 54.027
#pid_Ki: 0.770
#pid_Kd: 948.182
min_temp: 0
max_temp: 130

[heater_fan mcu_cooling_fan]
pin: PB7

[display]
lcd_type: emulated_st7920
spi_software_miso_pin: EXP2_1
spi_software_mosi_pin: EXP1_3
spi_software_sclk_pin: EXP1_5
en_pin: EXP1_4
#encoder_pins: ^EXP2_3, ^EXP2_5
encoder_pins: ^EXP2_5, ^EXP2_3
click_pin: ^!EXP1_2

[output_pin BEEPER_Pin]
pin: EXP1_1
scale: 5
pwm = true
#hardware_pwm: False
value = 0
shutdown_value = 0
cycle_time = 0.001

[idle_timeout]
timeout: 900

[board_pins]
aliases:
    # EXP1 header
    EXP1_1=PC5, EXP1_3=PB1, EXP1_5=PE9,  EXP1_7=PE11, EXP1_9=<GND>,
    EXP1_2=PB0, EXP1_4=PE8, EXP1_6=PE10, EXP1_8=PE12, EXP1_10=<5V>,
    # EXP2 header
    EXP2_1=PA6, EXP2_3=PE7, EXP2_5=PB2, EXP2_7=PC4,   EXP2_9=<GND>,
    EXP2_2=PA5, EXP2_4=PA4, EXP2_6=PA7, EXP2_8=<RST>, EXP2_10=<NC>

[temperature_sensor dell_pc]
sensor_type: temperature_host
min_temp: 10
max_temp: 100

[gcode_arcs]
#resolution: 1.0

[respond]
default_type: echo
default_prefix: S8:

